// SPDX-License-Identifier: Apache-2.0

pragma solidity ^0.8.7;
import "@openzeppelin/contracts/access/Ownable.sol";

contract GenerationalGenerativeRandomDraw is Ownable {

    uint64 idSpaceStart = 1;
    uint256 _currentStartIndex;

    // ---------- DRAW RANDOM CARD -------------
    uint256 public remaining;
    uint256 public genStartIndex;

    // ---------- MULTI OR DELETABLE MAPPING ---
    uint256 private _currentMappingVersion;
    mapping(uint256 => uint256) cache;

    // ---------- PRE-GENERATION ---------------
    uint64 preNumItems;
    uint256 generatorHash;
    uint256 generatorSeed;

    // ---------- GENERATIONS -------------------
    struct Generation {
        uint256 index;
        uint256 numItems;
        uint256 startIndex;
        uint256 timestamp;
        uint256 generatorHash;
        uint256 generatorSeed;
        uint256 provenanceHash;
    }
    Generation[] public _generationsArr;

    struct ProvenanceAmendment {
        uint256 genIndex;
        uint256 newProvenanceHash;
    }
    ProvenanceAmendment[] public _provenanceAmendArr;

    event PreGenerationEvent(uint256 preNummItems, uint256 preGeneratorHash, uint256 preGeneratorSeed);
    event NewGenerationEvent(uint256 index, uint256 numItems, uint256 startIndex, uint256 timestamp,
        uint256 generatorHash, uint256 generatorSeed, uint256 provenanceHash);
    event ProvenanceAmendmentEvent(uint256 provenanceHash, uint256 genIndex);

    // this function adds a lot of code size for some reason
//    function getGenerations() public view returns (Generation[] memory) {
//        return _generationsArr;
//    }

    function getCurrentGeneration() public view returns (Generation memory) {
        return _generationsArr[_generationsArr.length -1];
    }

    function amendProvenance(uint256 provenanceHash, uint256 genIndex) public onlyOwner {
        ProvenanceAmendment memory newProv = ProvenanceAmendment(genIndex, provenanceHash);
        _provenanceAmendArr.push(newProv);
        emit ProvenanceAmendmentEvent(provenanceHash, genIndex);
    }

    function getProvenanceAmendment() public view returns (ProvenanceAmendment memory) {
        return _provenanceAmendArr[_provenanceAmendArr.length -1];
    }

    function makeNewGeneration(uint64 numItems, uint256 provenanceHash) public onlyOwner {
        uint256 countGenerations = _generationsArr.length;
        Generation memory newGen;
        newGen.numItems = numItems;
        if (countGenerations > 0) {
            Generation memory lastGen = _generationsArr[countGenerations - 1];
            newGen.index = lastGen.index + 1;
            newGen.startIndex = lastGen.startIndex + lastGen.numItems;
        } else {
            newGen.index = 1;
            newGen.startIndex = idSpaceStart;
        }
        newGen.timestamp = uint64(block.timestamp);
        newGen.generatorHash = generatorHash;
        newGen.generatorSeed = generatorSeed;
        newGen.provenanceHash = provenanceHash;
        _generationsArr.push(newGen);
        _currentMappingVersion++;
        _currentStartIndex = newGen.startIndex;
        remaining = numItems;
        genStartIndex = newGen.startIndex;
        emit NewGenerationEvent(newGen.index, newGen.numItems, newGen.startIndex, newGen.timestamp, newGen.generatorHash, newGen.generatorSeed, newGen.provenanceHash);
    }

    function preGeneration(uint256 paramGeneratorHash, uint64 numItems) public onlyOwner returns (uint256) {
        preNumItems = numItems;
        generatorHash = paramGeneratorHash;
        uint256 randomSeed = uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp, generatorHash)));
        generatorSeed = randomSeed;
        emit PreGenerationEvent(numItems, generatorHash, randomSeed);
        return randomSeed;
    }

    function getGeneratorSeed() public view returns (uint256) {
        return generatorSeed;
    }

    function packUints(uint256 one, uint256 two) private pure returns(uint256) {
        uint256 packed = (one << 128) + two;
        return packed;
    }

    function getCache(uint256 index) private view returns(uint256) {
        uint256 key = packUints(_currentMappingVersion, index);
        return cache[key];
    }

    function setCache(uint256 index, uint256 card) private {
        uint256 key = packUints(_currentMappingVersion, index);
        cache[key] = card;
    }

    function drawIndex() internal returns(uint256 adjustedIndex) {
        //Random number
        uint256 i = uint256(blockhash(block.number - 1)) % remaining;
        // if there's a cache at cache[i] then use it, otherwise use i itself
        uint256 foundCard = getCache(i);
        uint256 index = foundCard == 0 ? i : foundCard;
        adjustedIndex = index + genStartIndex;
        // grab a number from the tail
        uint256 tailCard = getCache(remaining - 1);
        setCache(i, tailCard == 0 ? remaining - 1 : tailCard);
        remaining = remaining - 1;
    }

}
